                        </GridContainer>
                        <GridContainer>
                            <GridItem xs={12} sm={12} md={8} >
                                <span style={{ fontSize: 14, color: '#aaaaaa' }}><b>Paz y salvo de administración *</b></span>
                                {pazSalvoAdministraData()}
                            </GridItem>
                            <GridItem xs={12} sm={12} md={1} >
